import React from "react";
import "../../assets/css/allQuestions.css";
import '../../assets/css/singleQuestion.css';

const SingleQuery = () => {
  return (
    <div>
      <div className="allQuestions">
        <div className="d-flex justify-content-between ps-lg-4 pe-ls-5 ps-2 pe-2">
            <div className="d-flex flex-column">
                <h3 className="pt-1 questionHeader">
                    Whatâ€™s the best state management library for react?
                </h3>
                <div className="d-flex justify-content-between ask_view">
                    <p>Asked <b>32 minutes ago</b></p>
                    <p>Viewed <b>3 times</b></p>
                </div>
            </div>
          <div>
            <button className="query ps-3 pe-3">Ask Query</button>
          </div>
        </div>
        <div className="ps-lg-4 pe-ls-5 ps-2 pe-2 pt-4">

        </div>
        <div className="bottom_line"></div>
      </div>
    </div>
  );
};

export default SingleQuery;
